import React, {Component} from 'react';
import {Navbar, Container, Nav, Button} from 'react-bootstrap';
import { Link } from "react-router-dom";
import './styles/navtop.scss';

class NavTop extends Component {
    render() {
        return (
            <>
                <Navbar bg="success" variant="dark">
                    <Container>
                        <Navbar.Brand>Моё Боровское</Navbar.Brand>
                        <Nav className="me-auto">
                            <Nav.Link>
                                <Link className="nav-link-decoration" to="/">Главная</Link>
                            </Nav.Link>
                            <Nav.Link>
                                <Link className="nav-link-decoration" to="/news">Новости</Link>
                            </Nav.Link>
                        </Nav>
                        <Navbar.Collapse className="justify-content-end">
                            {/*<Navbar.Text>*/}
                            {/*    Signed in as: <a href="#login">Mark Otto</a>*/}
                            {/*</Navbar.Text>*/}
                            <Nav.Link>
                                <Button variant="outline-warning">Login</Button>
                            </Nav.Link>
                            <Nav.Link>
                                <Button variant="outline-warning">Logout</Button>
                            </Nav.Link>

                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </>
        )
    }
}

export default NavTop;
